import { BrowserRouter, Routes, Route } from "react-router-dom";
import "../css/home.css";
import VerantsElement from "../../verants_comp/js/verants.js";
function Home() {
  return (
    <>
      <div className="home-element-main-container">
        <div className="top-home-nav-bar">
          <div className="top-nav-home-options">
            <div className="top-nav-option top-nav-option-home">Home</div>
            <div className="top-nav-option top-nav-option-home">Shop</div>
            <div className="top-nav-option top-nav-option-home">V-Pass</div>
            <div className="top-nav-option top-nav-option-home">Skin</div>
            <div className="top-nav-option top-nav-option-home">Rank</div>
            <div className="top-nav-option top-nav-option-home">Verants</div>
          </div>
          <div className="verants-container">
            <div className=""><VerantsElement scale="0.34"/></div>
            <div className="verants-count">1,500</div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
